import React, { useState, useEffect } from 'react';

export default function FormularioContrato({ contrato, onSalvar, onCancelar }) {
  const contratoInicial = {
    cliente: '',
    estado: '',
    valorGlobal: '',
    valorComissao: '',
    objeto: '',
    qtdElevadores: '',
    qtdPlataformas: '',
    inicio: '',
    encerramento: '',
    gestor: '',
    telefone: '',
    email: '',
    necessitaArt: false,
  };

  const [form, setForm] = useState(contrato || contratoInicial);

  useEffect(() => {
    setForm(contrato || contratoInicial);
  }, [contrato]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    const val = type === 'checkbox' ? checked : value;
    let updatedForm = { ...form, [name]: val };

    if (name === 'valorGlobal') {
      const num = parseFloat(val.replace(',', '.')) || 0;
      updatedForm.valorComissao = (num * 0.04).toFixed(2);
    }
    setForm(updatedForm);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSalvar(form);
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-4xl mx-auto p-4 bg-white rounded shadow">
      <h1 className="text-xl font-bold mb-4">{contrato ? 'Editar Contrato' : 'Novo Contrato'}</h1>
      
      <input
        type="text"
        name="cliente"
        value={form.cliente}
        onChange={handleChange}
        placeholder="Órgão / Cliente"
        className="mb-2 p-2 border rounded w-full"
        required
      />

      <select
        name="estado"
        value={form.estado}
        onChange={handleChange}
        className="mb-2 p-2 border rounded w-full"
        required
      >
        <option value="">Selecione um estado</option>
        {/* Lista de estados */}
        <option value="AC">Acre</option>
        <option value="AL">Alagoas</option>
        {/* ...resto dos estados */}
      </select>

      <input
        type="text"
        name="valorGlobal"
        value={form.valorGlobal}
        onChange={handleChange}
        placeholder="Valor Global (R$)"
        className="mb-2 p-2 border rounded w-full"
        required
      />

      <input
        type="text"
        name="valorComissao"
        value={form.valorComissao}
        disabled
        placeholder="Valor da Comissão (4%)"
        className="mb-2 p-2 border rounded w-full bg-gray-100"
      />

      {/* Campos adicionais */}
      <input
        type="text"
        name="objeto"
        value={form.objeto}
        onChange={handleChange}
        placeholder="Objeto do Contrato"
        className="mb-2 p-2 border rounded w-full"
        required
      />
      
      <input
        type="number"
        name="qtdElevadores"
        value={form.qtdElevadores}
        onChange={handleChange}
        placeholder="Quantidade de Elevadores"
        className="mb-2 p-2 border rounded w-full"
      />

      <input
        type="number"
        name="qtdPlataformas"
        value={form.qtdPlataformas}
        onChange={handleChange}
        placeholder="Quantidade de Plataformas"
        className="mb-2 p-2 border rounded w-full"
      />

      <input
        type="date"
        name="inicio"
        value={form.inicio}
        onChange={handleChange}
        className="mb-2 p-2 border rounded w-full"
      />

      <input
        type="date"
        name="encerramento"
        value={form.encerramento}
        onChange={handleChange}
        className="mb-2 p-2 border rounded w-full"
      />

      <input
        type="text"
        name="gestor"
        value={form.gestor}
        onChange={handleChange}
        placeholder="Gestor (opcional)"
        className="mb-2 p-2 border rounded w-full"
      />

      <input
        type="tel"
        name="telefone"
        value={form.telefone}
        onChange={handleChange}
        placeholder="Telefone (opcional)"
        className="mb-2 p-2 border rounded w-full"
      />

      <input
        type="email"
        name="email"
        value={form.email}
        onChange={handleChange}
        placeholder="E-mail (opcional)"
        className="mb-2 p-2 border rounded w-full"
      />

      <label className="flex items-center gap-2 mb-4">
        <input
          type="checkbox"
          name="necessitaArt"
          checked={form.necessitaArt}
          onChange={handleChange}
        />
        Necessita de ART
      </label>

      <div className="flex gap-2">
        <button
          type="submit"
          className="bg-green-600 hover:bg-green-700 text-white py-2 px-4 rounded"
        >
          Salvar
        </button>
        <button
          type="button"
          onClick={onCancelar}
          className="bg-gray-400 hover:bg-gray-500 text-white py-2 px-4 rounded"
        >
          Cancelar
        </button>
      </div>
    </form>
  );
}
